q($,"aRc","aBH",function(){var p=$.eb()
return R.d1("Corvidae (crows)",C.bl,"Green","The magpie (or Eurasian magpie) is a very distinctive and handsome bird and one of the easiest corvids to identify. It is a pied, or black and white bird whose wing and tail feathers feature blue and blue-green-purple iridescence. Males and females look alike, but the female is slightly smaller. They are 44-46cm long with the tail accounting for over half of this length, and weigh 200-250g. They are very sociable and vocal birds.\n\nHowever, possibly more than any other bird, the magpie is associated with a range of mostly negative superstitions both across ages and in many different cultures. This could be because as scavengers, magpies have been associated with death, and because of that, with bad luck. The Victorians feared the magpie, and hunted it almost to extinction. It is also disliked because it predates the nests of other birds, particularly song birds.\n\nMagpies are omnivorous, and as well as predating nests and feeding on carrion and road kill, they eat invertebrates, fruit and berries and small mammals. They hoard food when it is scarce, hiding the food in a hole in the ground which they cover with leaves or grass.\n\nBoth birds make the nest, with the male collecting most of the materials for it. The nest is a large cup of twigs, grass, hair and mud, surrounded by a dome made from larger twigs, and with one or two entrances, although some birds don\u2019t bother with domes. The nest, located in dense bushes or high up in trees, may take 5-6 weeks to make. The female lays around 5-8 eggs, which she incubates for around 19 days. The male feeds the female while she is brooding. The young fledge after about four weeks and continue to be fed by the parents for up to a month. The family stays together as a unit until the autumn. Young birds may form flocks, and feed and roost together.\n\nBreeding magpies maintain their territories all year round. As there are more individuals in an area than there are nesting sites available, many birds do not breed.\n\nIt\u2019s estimated there are around 600,000 breeding territories in the UK.",18,H.b([R.aH("assets/magpie.png",p),R.aH("assets/magpie1.png",p),R.aH("assets/magpie3.png",p)],t.R),"Magpie","Pica pica")})
q($,"aRo","aBQ",function(){return R.d1("Woodpeckers",C.bl,"Green","The great spotted woodpecker one of three woodpeckers native to Britain. It is a bird that is shy of humans, and so can be difficult to see. It is more commonly heard than seen.\n\nThis species is a broadleaved woodland specialist, but is very adaptable, and is also found in coniferous woodland, and parks and gardens where trees are plentiful. They particularly like oak and horn beam trees.\n\nThe great spotted woodpecker is a pied (black and white) woodpecker. At 21-23 cm long, it is about starling sized. It weights about 85 grams. The male and female are very similar, with a white underside, white and black back and wings and white cheeks and shoulder patches. Both male and female have a bright red underside at the base of the tail, but only the male has a red patch at the back of his neck. The nape of the female\u2019s neck is white. Juveniles may be seen in summer: they are distinguished from their parents by having a red cap, which disappears after their first moult.\n\nThey have very strong claws for gripping the bark, and also use their stiff tail feathers as support when hopping up trees and gripping while chiselling and drumming. They have two toes which point frontwards, and two pointing backwards.\n\nThe great spotted woodpecker flight pattern is undulating. This is because it folds its wings against its body every few wing flaps.\n\nDead trees, rich in insect life, are an important location of food for them. The woodpecker probes both living and dead trees for larvae and insects, uses its powerful beak to hammer holes in the bark. Their extremely long and sticky tongues assist in extracting insects, spiders and caterpillars from crevices and holes. In winter they feed on nuts and berries, and will visit bird feeders for suet, peanuts and seeds throughout the year. Woodpeckers will take eggs and nestlings from nests, including from nest boxes. If nest boxes are made of wood, they will enlarge the size of the hole to gain entry.\n\nThe woodpecker is known for its drumming. This is a rapid hammering on a trunk of up to 20 times per second, which lasts a few seconds. Drumming serves several functions. It may be used to maintain contact between a pair, but its main function is to establish and proclaim a territory. The species is strongly territorial. The bird chooses a healthy tree on which to drum, in order to make the loudest sound. Both males and females drum from the late winter. The male drums more frequently than the female. Drumming usually ceases after the young have fledged.\n\nTerritorial and contact drumming are a more rapid drumming than that which characterises the bird\u2019s nest-making chiselling.\n\nThe great spotted woodpecker nests in mature and old trees, excavating a hole in the trunk or branch by chiselling a cavity, and lining it with wood chip. It can take up to four weeks for a pair to chisel out a cavity, but the work is shared equally between male and female. The woodpeckers make a new nest hole every year, which means they have a significant ecological role in leaving many potential nest sites for other birds and animals. They may also use old holes as night time roosts.\n\nGreat spotted woodpeckers are monogamous in a breeding season, but may have different partners in different seasons.\n\nBreeding starts in mid-April. 3-8 eggs are laid, and there\u2019s generally just one clutch in a breeding season. Both parents incubate and feed the young. Incubation takes around 2 weeks, and fledging occurs about 3 weeks after hatching. After fledging, the adults continue to feed the young for another 10 or so days.\n\nIt\u2019s estimated that there are around 140,000 breeding pairs, mostly in England and Wales.",19,H.b([R.aH("assets/woodpecker.png",$.eb())],t.R),"Great Spotted Woodpecker","Dendrocopos major")})
